bool caasCLR4TxHOG::DrawLineSegments(vector<Vec4f>& lsdLines, Mat& lsdImage)
{
	bool some_lines_are_drawn = false;
	for (int i = 0; i < lsdLines.size(); i++)
	{
		float x1 = lsdLines[i][0], y1 = lsdLines[i][1];
		float x2 = lsdLines[i][2], y2 = lsdLines[i][3];

		//We don't care the small regions 5 pixels to the boundary.
		if (x1 <= 5 || x2 <= 5) continue;
		if (y1 <= 5 || y2 <= 5) continue;
		if (lsdImage.cols - x1 <= 5 || lsdImage.cols - x2 <= 5) continue;
		if (lsdImage.rows - y1 <= 5 || lsdImage.rows - y2 <= 5) continue;

		some_lines_are_drawn = true;
		line(lsdImage, Point((int)(x1 + 0.5), (int)(y1 + 0.5)), Point((int)(x2 + 0.5), (int)(y2 + 0.5)), Scalar(255));
	}

	return some_lines_are_drawn;
}

caasCLR4TxHOG::caasCLR4TxHOG(const caasInput* input) : caasCLR4TxBase(input)
{
	TARGET_SIZE_ORIGINAL = Size(500, 2500);
	TARGET_SIZE_HOG = Size(40, 200);
	TARGET_SCALING = 12.5f;

	ISOLATOR_SIZE_ORIGINAL = Size(500, 500);
	ISOLATOR_SIZE_HOG = Size(80, 80);
	ISOLATOR_SCALING = 6.25f;

	BASE_SIZE_ORIGINAL = Size(160, 1200);
	BASE_SIZE_HOG = Size(32, 240);
	BASE_SCALING = 5.0f;

	Size blockSize(16, 16);
	Size blockStride(8, 8);
	Size cellSize(8, 8);
	Size trainPadding(0, 0);
	int nbins = 9;
	int derivAperture = 1;
	double winSigma = -1;
	double L2HysThreshold = 0.2;
	bool gammaCorrection = true;

	targetHOG = HOGDescriptor(TARGET_SIZE_HOG, blockSize, blockStride, cellSize, nbins, derivAperture, winSigma, 0, L2HysThreshold, gammaCorrection);
	targetHOG.setSVMDetector(Mat(1, TARGET_HOG_N, CV_32FC1, (void*)&CLR4Tx_TARGET_SVM));

	isolatorHOG = HOGDescriptor(ISOLATOR_SIZE_HOG, blockSize, blockStride, cellSize, nbins, derivAperture, winSigma, 0, L2HysThreshold, gammaCorrection);
	isolatorHOG.setSVMDetector(Mat(1, ISOLATOR_HOG_N, CV_32FC1, (void*)&CLR4Tx_ISOLATOR_SVM));

	baseHOG = HOGDescriptor(BASE_SIZE_HOG, blockSize, blockStride, cellSize, nbins, derivAperture, winSigma, 0, L2HysThreshold, gammaCorrection);
	baseHOG.setSVMDetector(Mat(1, BASE_HOG_N, CV_32FC1, (void*)&CLR4Tx_BASE_SVM));
}

void caasCLR4TxHOG::Inspect()
{
	IMWRITE("0.1.gray.jpg", imageGray);

	LocateTarget();
	RefineTarget();

	LocateIsolator();
	RefineIsolator();

	FindIsolatorAngle();

	LocateBase();
	RefineBase();

	return;
}

void caasCLR4TxHOG::LocateTarget()
{
	int width = (int)(imageGray.cols / TARGET_SCALING + 0.5),
		height = (int)(imageGray.rows / TARGET_SCALING + 0.5);
	Mat imageSmall; resize(imageGray, imageSmall, Size(width, height));

	Size winStride(4, 4); std::vector<cv::Point> foundLocations; std::vector<double> weights;
	targetHOG.detect(imageSmall, foundLocations, weights, 0.0, winStride);

	targetHOGResults.clear();
	for (int i = 0; i < weights.size(); i++)
	{
		//if (foundLocations[i].y <= 0) continue;
		//if (foundLocations[i].y + TARGET_SIZE_HOG.height >= height) continue;
		if (foundLocations[i].x <= 0) continue;
		if (foundLocations[i].x + TARGET_SIZE_HOG.width >= width) continue;

		HoGResult hog_result;		hog_result.weight = weights[i];		hog_result.location = foundLocations[i];
		targetHOGResults.push_back(hog_result);
	}

	if (targetHOGResults.size() <= 0) throw "Locating Target Error!";

	sort(targetHOGResults.begin(), targetHOGResults.end(), SortHoGResultByWeight);

	//for (int i = 0; i < targetHOGResults.size(); i++)
	//for (int i = 0; i < 9; i++)
	//{
	//	Point point = targetHOGResults[i].location;
	//	Rect roi = Rect(point.x, point.y, TARGET_SIZE_HOG.width, TARGET_SIZE_HOG.height);
	//	Mat cropped = imageSmall(roi);
	//	imwrite("LED6.2_50um" + std::to_string(i) + ".bmp", cropped);
	//	//imwrite("temp.bmp", cropped);
	//}
}

void caasCLR4TxHOG::RefineTarget()
{
	//We try the Top 1 candidate
	int x = (int)(targetHOGResults[0].location.x * TARGET_SCALING + 0.5);
	int y = (int)(targetHOGResults[0].location.y * TARGET_SCALING + 0.5);

	targetLeftEdge = x;
	targetRightEdge = x + TARGET_SIZE_ORIGINAL.width;
	targetTopEdge = y;
	targetBottomEdge = y + TARGET_SIZE_ORIGINAL.height;

	Rect rect = Rect(x, y, TARGET_SIZE_ORIGINAL.width, TARGET_SIZE_ORIGINAL.height);
	if (rect.x < 0 || rect.y < 0 || rect.x + rect.width > imageGray.cols || rect.y + rect.height > imageGray.rows) throw "Refining Target Error!";
	Mat imageTarget = imageGray(rect);

	IMWRITE("1.1.Target.jpg", imageTarget);

	Mat imageTargetOtsu; 	threshold(imageTarget, imageTargetOtsu, 0, 255, CV_THRESH_BINARY | CV_THRESH_OTSU);

	IMWRITE("1.2.TargetOtsu.jpg", imageTargetOtsu);

	{//vertical projection profile
		Mat verProjection(1, imageTargetOtsu.cols, CV_32FC1);
		reduce(imageTargetOtsu, verProjection, 0, CV_REDUCE_SUM, CV_32FC1); //Vertical projection generates Horizontal profile

		float minValue, maxValue; int minIndex, maxIndex; float values[4096];
		ProjectionProfileAnalysis(verProjection, minValue, minIndex, maxValue, maxIndex, values);

		float mean = 0;	for (int i = 0; i < imageTargetOtsu.cols; i++)	mean += values[i]; mean /= imageTargetOtsu.cols;
		
		//search from left to right and find the 1st location, the projection value is larger than 1/3 of mean.
		for (int i = 0; i < imageTargetOtsu.cols / 2; i++)
		{
			if (values[i] > mean / 3)
			{
				targetLeftEdge += i; 
				//targetRightEdge = targetLeftEdge + TARGET_ORIGINAL_WIDTH;
				break;
			}
		}
	}
}

void caasCLR4TxHOG::LocateIsolator()
{
	int width = (int)(imageGray.cols / ISOLATOR_SCALING + 0.5),
		height = (int)(imageGray.rows / ISOLATOR_SCALING + 0.5);
	Mat imageSmall; resize(imageGray, imageSmall, Size(width, height));

	//We search to the middle of target only.
	Rect rect = Rect(0, 0, (int)((targetLeftEdge + targetRightEdge) / (2 * ISOLATOR_SCALING) + 0.5), imageSmall.rows);
	imageSmall = imageSmall(rect);

	Size winStride(4, 4);	std::vector<cv::Point> foundLocations; std::vector<double> weights;
	isolatorHOG.detect(imageSmall, foundLocations, weights, 0.0, winStride);

	isolatorHOGResults.clear();
	for (int i = 0; i < weights.size(); i++)
	{
		if (foundLocations[i].y <= 0) continue;
		if (foundLocations[i].y + ISOLATOR_SIZE_HOG.height >= imageSmall.rows) continue;
		if (foundLocations[i].x <= 0) continue;
		if (foundLocations[i].x + ISOLATOR_SIZE_HOG.width >= imageSmall.cols) continue;

		HoGResult hog_result;		hog_result.weight = weights[i];		hog_result.location = foundLocations[i];
		isolatorHOGResults.push_back(hog_result);
	}

	if (isolatorHOGResults.size() <= 0) throw "Locating Isolator Error!";

	sort(isolatorHOGResults.begin(), isolatorHOGResults.end(), SortHoGResultByWeight);

	//for (int i = 0; i < isolatorHOGResults.size(); i++)
	//for (int i = 0; i < 9; i++)
	//{
	//	Point point = isolatorHOGResults[i].location;
	//	Rect roi = Rect(point.x, point.y, ISOLATOR_SIZE_HOG.width, ISOLATOR_SIZE_HOG.height);
	//	Mat cropped = imageSmall(roi);
	//	imwrite("LED6.2_50um" + std::to_string(i) + ".bmp", cropped);
	//	//imwrite("temp.bmp", cropped);
	//}
}

void caasCLR4TxHOG::RefineIsolator()
{
	//We try the Top 1 candidate
	int x = (int)(isolatorHOGResults[0].location.x * ISOLATOR_SCALING + 0.5),
		y = (int)(isolatorHOGResults[0].location.y * ISOLATOR_SCALING + 0.5);

	//We just look half of the isolator
	Rect rect = Rect(x + ISOLATOR_SIZE_ORIGINAL.width / 2, y, ISOLATOR_SIZE_ORIGINAL.width / 2, ISOLATOR_SIZE_ORIGINAL.height);
	if (rect.x < 0 || rect.y < 0 || rect.x + rect.width > imageGray.cols || rect.y + rect.height > imageGray.rows) throw "Refining Isolator (1) Error!";
	Mat imageIsolator = imageGray(rect);

	IMWRITE("2.1.Isolator.jpg", imageIsolator);

	//isolatorRightEdge -= (ISOLATOR_ORIGINAL_WIDTH - 364) / 2;

	//Histogram Equalization
	Mat imageEqualized; equalizeHist(imageIsolator, imageEqualized);
	
	IMWRITE("2.2.IsolatorEqualized.jpg", imageEqualized);

	//Blur the image
	Mat imageBlurred;	double GAUSSIAN_RADIUS = 4.0;	GaussianBlur(imageEqualized, imageBlurred, Size(0, 0), GAUSSIAN_RADIUS);

	IMWRITE("2.3.IsolatorBlurred.jpg", imageBlurred);

	vector<Vec4f> lsdLines;  DetectLineSegments(imageBlurred, lsdLines);
	//Draw lines on a binary image
	Mat imageLines(imageBlurred.rows, imageBlurred.cols, CV_8UC1, Scalar(0));
	if (!DrawLineSegments(lsdLines, imageLines)) throw "Refining Isolator (2) Error!";

	IMWRITE("2.4.IsolatorLines.jpg", imageLines);

	Mat points;	findNonZero(imageLines, points); 
	Rect min_rect = boundingRect(points);

	isolatorRightEdge = rect.x + min_rect.x + min_rect.width;
	isolatorLeftEdge = isolatorRightEdge - ISOLATOR_SIZE_ORIGINAL.width * 3 / 4;
	isolatorTopEdge = rect.y + min_rect.y - 10;
	isolatorBottomEdge = isolatorTopEdge + min_rect.height + 20;

	//Canny Edge Detection
//	int median = Median(imageIsolator);
//	Mat imageIsolatorCanny;  Canny(imageIsolator, imageIsolatorCanny, 0.66 * median, 1.33 * median);
//	IMWRITE("2.4.IsolatorCanny.jpg", imageIsolatorCanny);

}

void caasCLR4TxHOG::FindIsolatorAngle()
{
	Rect rect_isolator = Rect(isolatorLeftEdge, isolatorTopEdge, isolatorRightEdge - isolatorLeftEdge, isolatorBottomEdge - isolatorTopEdge);
	Mat imageIsolator = imageGray(rect_isolator);

	IMWRITE("3.1.Isolator.jpg", imageIsolator);

	//Histogram Equalization
	Mat imageEqualized; equalizeHist(imageIsolator, imageEqualized);
	IMWRITE("3.2.IsolatorEqualized.jpg", imageEqualized);

	//Blur the image
	Mat imageBlurred;	double GAUSSIAN_RADIUS = 4.0;
	GaussianBlur(imageEqualized, imageBlurred, Size(0, 0), GAUSSIAN_RADIUS);

	IMWRITE("3.3.IsolatorBlurred.jpg", imageBlurred);

	vector<Vec4f> lsdLines;  DetectLineSegments(imageBlurred, lsdLines);
	//Draw lines on a binary image
	Mat imageLines(imageBlurred.rows, imageBlurred.cols, CV_8UC1, Scalar(0));
	if (!DrawLineSegments(lsdLines, imageLines)) throw "Find Isolator Angle Error!";
	
	IMWRITE("3.4.IsolatorLines.jpg", imageLines);

	Mat points;	findNonZero(imageLines, points);
	RotatedRect rect = minAreaRect(points);

	//rect.angle is in [-0, -90) range, let's assume [-0, -45) corresponds to positive angles and [-45, -90) corresponds to negative angles
	if (rect.angle > -45.0)
		isolatorAngle = -rect.angle; 
	else isolatorAngle = -(90 + rect.angle);
}

void caasCLR4TxHOG::LocateBase()
{
	int width = (int)(imageGray.cols / BASE_SCALING + 0.5),
		height = (int)(imageGray.rows / BASE_SCALING + 0.5);
	Mat imageSmall; resize(imageGray, imageSmall, Size(width, height));

	//We search olny  of target only.
	int left = (int)(targetRightEdge / BASE_SCALING + 0.5);
	int top = (int)(targetTopEdge / BASE_SCALING + 0.5);
	int right = (int)((2 * targetRightEdge - targetLeftEdge) / BASE_SCALING + 0.5); //We search in right of target within the width of target.
	int bottom = (int)(targetBottomEdge / BASE_SCALING + 0.5);
	imageSmall = imageSmall(Rect(left, top, right - left, bottom - top));

	Size winStride(4, 4);	std::vector<cv::Point> foundLocations; std::vector<double> weights;
	baseHOG.detect(imageSmall, foundLocations, weights, 0.0, winStride);

	baseHOGResults.clear();
	for (int i = 0; i < weights.size(); i++)
	{
		//if (foundLocations[i].y <= 0) continue;
		//if (foundLocations[i].y + BASE_SIZE_HOG.height >= imageSmall.rows) continue;
		//if (foundLocations[i].x <= 0) continue;
		//if (foundLocations[i].x + BASE_SIZE_HOG.width >= imageSmall.cols) continue;

		HoGResult hog_result;		hog_result.weight = weights[i];		hog_result.location = foundLocations[i];
		baseHOGResults.push_back(hog_result);
	}

	if (baseHOGResults.size() <= 0) throw "Locating Base Error!";

	sort(baseHOGResults.begin(), baseHOGResults.end(), SortHoGResultByWeight);
}

void caasCLR4TxHOG::RefineBase()
{
	//We try the Top 1 candidate
	int x = (int)((baseHOGResults[0].location.x + left)* BASE_SCALING + 0.5),
		y = (int)((baseHOGResults[0].location.y + top)* BASE_SCALING + 0.5);

	//We just look half of the isolator
	Rect rect = Rect(x, y, BASE_SIZE_ORIGINAL.width, BASE_SIZE_ORIGINAL.height);
	if (rect.x < 0 || rect.y < 0 || rect.x + rect.width > imageGray.cols || rect.y + rect.height > imageGray.rows) throw "Refining Isolator (1) Error!";
	Mat imageBase = imageGray(rect);

	IMWRITE("4.1.Base.jpg", imageBase);
}
